function FullNote(props) {
  return (
    <div className="view">
      <div className="view-p">
        <h2 className="view-h2">{props.head1}</h2>
        <p className="vie">{props.body1}</p>
      </div>
      <button onClick={props.chNote} className="view-close" type="button">
        close
      </button>
    </div>
  );
}

export default FullNote;
